import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
      {/* HEAD (note: in a typical React app, you'd handle <title> and <link> 
          in public/index.html or using react-helmet, but here's inline for clarity) */}
      <head>
        <link rel="icon" href="/images/Logo 1.png" />
        <title>Pixelate</title>
      </head>

      {/* NAVBAR */}
      <nav className="navbar">
        <div className="navbar-container">
          <div className="nav-left">
            <img
              src="/images/Logo 1.png"
              alt="Pixelate Logo"
              className="nav-logo"
            />
            {/* <span className="nav-brand">PIXELATE</span> */}
          </div>
          <div className="nav-right">
            <ul className="nav-links">
              <li><a href="#home">Home</a></li>
              <li><a href="#about">About</a></li>
              <li><a href="#services">Services</a></li>
              <li><a href="#contact">Contact</a></li>
            </ul>
          </div>
        </div>
      </nav>

      {/* HERO / TOP SECTION */}
      <section className="hero-section" id="home">
        <div className="hero-content">
          <h1 className="hero-title">Design the Future</h1>
          <p className="hero-subtext">
            Revolutionizing the precision-crafted goods industry by automating
            manual conversion of 2D blueprints into 3D models
            At Pixelate, we believe in pushing the boundaries and making impossible possible.At Pixelate, we are building a future
           version of Industrial Design Intelligence where design and technology merge to enhance creativity and accuracy. 
            Together, we can reshape the way designs take form.
          </p>
          <button className="hero-button">Launch Pixelate Studio</button>
          {/* Optional hero image below the button */}
          <div className="hero-image-container">
            {/* <img
              src="/images/placeholder-hero.png"
              alt="Hero Visual"
              className="hero-image"
            /> */}
          </div>
        </div>
      </section>

      {/* ABOUT SECTION */}
      <section className="about-section" id="about">
        <h2>About Pixelate</h2>
        <p className="about-text">
        Pixelate is a cutting-edge startup founded by Cornell University students, driven by a passion for technological innovation and excellence. Our goal is 
        to revolutionize the manufacturing industry by developing and deploying state-of-the-art AI software and services. 
        </p>
        <div className="stats-container">
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Some quick info</p>
          </div>
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Some quick info</p>
          </div>
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Some quick info</p>
          </div>
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Some quick info</p>
          </div>
        </div>
        {/* Optional image underneath the stats */}
        <div className="about-image-container">
          {/* <img
            // src="/images/Group 1.png"
            alt="About Illustration"
            className="about-image"
          /> */}
        </div>
      </section>

    {/* SERVICES SECTION */}
<section className="services-section" id="services">
  <h2>Our Services</h2>
  <div className="services-container">
    {/* Photo Lifting (Top, aligned left) */}
    <div className="service-wrapper align-left">
      <div className="service-box">
        <h3>Photo Lifting</h3>
        <p>Description of the service.
          place holderplace holderplace holderplace holderplace holderplace holderplace holderplace holderplace holderplace holderplace holderplace holderplace holderplace holderplace holderplace holder
        </p>

      </div>
    </div>

    {/* All in one hub for CAD (Bottom, aligned right) */}
    <div className="service-wrapper align-right">
      <div className="service-box">
        <h3>All in one hub for CAD</h3>
        <p>Description of the service.</p>
        {/* Image placeholder (uncomment to use)
        <img
          src="/images/placeholder-service2.png"
          alt="CAD Services"
          className="service-image"
        /> */}
      </div>
    </div>
  </div>
</section>

      {/* CONTACT SECTION */}
      <section className="contact-section" id="contact">
        <h2>Contact Us</h2>
        <p className="contact-text">
        We are always open to discuss new value-adding partnerships. Do reach out if you are an exchange or a project looking for liquidity; an algorithmic trader 
        or a software developer looking to improve the markets with us or just have a great idea you can’t wait to share with us!
        </p>
        <ul className="contact-details">
          <li><strong>Email:</strong></li>
        </ul>
      </section>

      {/* EXTRA IMAGE SECTION (underneath everything else) */}
      <section className="extra-image-section">
        <div className="extra-image-container">
          {/* <img
            src="/images/placeholder-extra.png"
            alt="Extra Visual"
            className="extra-image"
          /> */}
        </div>
      </section>

      {/* FOOTER */}
      {/* <footer className="footer-section">
        <p>© 2023 Pixelate. All rights reserved.</p>
      </footer> */}
    </div>
  );
};

export default Home;
